webpackJsonp([0xa82e7a748e68],{6730:function(e,t){e.exports={data:{post:{html:'<p>Chancellor Schröder may not give interviews to the Bild Zeitung, but Bundespresident candidate gave <a title="Bild.T-Online.de - Nachrichten - Exklusiv: Horst Köhler spricht in BILD" href="http://www.bild.t-online.de/BTO/news/2004/03/10/koehler/koehler.html">Bild an exclusive interview</a> (and unlike the <a title="Bild.T-Online.de" href="http://www.bild.t-online.de/BTO/index.html">Bild home page</a>, the link is safe for work, even for Americans). It\'s a pro-CDU campaign from Bild, what else would you expect, but Köhler is saying a lot of the right things (quoting JFK: Ask not what your country can do for you...). I\'m anxious to hear him give a speech to see if he measures up to von Weizsacker and Herzog.</p>',fields:{title:"",date:"10 Mar 2004",url:"https://papascott.de/2004-03-10-koehler-fuer-deutschland/"}}},pathContext:{slug:"/2004-03-10-koehler-fuer-deutschland/",prev:{fields:{title:"iNotes Tech Support",date:"09 Mar 2004",slug:"/2004-03-09-inotes-tech-support/"}},next:{fields:{title:"Death in Madrid",date:"11 Mar 2004",slug:"/2004-03-11-death-in-madrid/"}}}}}});
